var profile_picture  = new function(){console.log('Dynamic profile_picture forms js loaded');document.addEventListener('DOMContentLoaded',function(){FormFunctions.tidyMultiInputs();let forms=document.querySelectorAll(`[data-formid="23"]`);forms.forEach(form=>{form.querySelectorAll(`select, input, textarea`).forEach(el=>profile_picture.p(el));});});var prevEl='';var q=function(event){var el=event.target;form=el.closest('form');var n=el.getAttribute('name');if(n==''||n==undefined){if(el.closest('.nice-select-dropdown')!=null&&el.closest('.inputwrapper')!=null){el.closest('.inputwrapper').querySelectorAll('select').forEach(select=>{if(el.dataset.value==select.value){el=select;n=select.name;}});}else{return;}}if(el==prevEl){return;}prevEl=el;setTimeout(function(){prevEl='';},50);if(n=='nextBtn'){FormFunctions.nextPrev(1);}else if(n=='prevBtn'){FormFunctions.nextPrev(-1);}profile_picture.p(el);};window.addEventListener('click',q);window.addEventListener('input',q);this.p=function(el){var n=el.getAttribute('name');var form=el.closest('form');if(n=='profile_picture'){var v_1=FormFunctions.getFieldValue('profile_picture',form,true,'hgg',true);if(v_1=='hgg'){FormFunctions.changeVisibility('add',form.querySelector('[name="hidden_label"]').closest('.inputwrapper'),profile_picture.p);}}};};if(typeof(urlSearchParams)=='undefined'){window.urlSearchParams=new URLSearchParams(window.location.search.replaceAll('&amp;','&'));}Array.from(urlSearchParams).forEach(array=>document.querySelectorAll(`[name^='${array[0]}']`).forEach(el=>FormFunctions.changeFieldValue(el,array[1],profile_picture.p,el.closest('form'),)));

